import React from 'react'
import { Field, reduxForm} from 'redux-form'

class RegisterFormComponent extends React.Component{

    renderInput({lable, type}){
        return <div>
            <lable>{lable}</lable>
            <input type={type} />
        </div>
    }

    render(){
        return (
            <div>
                <form>
                    <Field name="username" component={this.renderInput} lable="Username" type="text"/>
                    <Field name="password" component={this.renderInput} lable="Username" type="password"/>
                    <Field name="re-password" component={this.renderInput} lable="Username" type="password"/>
                    <Field name="email" component={this.renderInput} lable="Username" type="email"/>
                    <Field name="mobileNo" component={this.renderInput} lable="Username" type="number"/>
                    <button type="submit" >Register</button>
                </form>
            </div>
        )
    }
}

const validate = (formValues) => {
    return {}
}
export default reduxForm({
    form : 'RegisterForm',
    validate : validate
})(RegisterFormComponent)
